import "./App.css";
import { useState, useEffect } from "react";

function App() {
  const [banks, setBanks] = useState([]);
  useEffect(() => {
    fetch("/api/banks")
      .then((res) => res.json())
      .then((data) => setBanks(data));
  }, []);

  return <div className="App">{}</div>;
}

export default App;
